`,nt=[{name:"Mgr. Vít Dostál, Ph.D.",text:"Je výkonným ředitelem Asociace pro mezinárodní otázky (AMO) a externě přednáší na Katedře mezinárodních vztahů a evropských studií Masarykovy univerzity v Brně. Odborně se zaměřuje na českou zahraniční a evropskou politiku, středoevropskou spolupráci a polskou zahraniční a domácí politiku."},{name:"Mgr. David František Wagner",text:"Vystudoval Pedagogickou fakultu Univerzity Karlovy, působí jako autor vzdělávacích i volnočasových her a od roku 2017 jako poradce v české Poslanecké sněmovně a Evropském parlamentu, kde vystupuje za Pirátskou stranu a vede programovou skupinu republikového výboru strany."},{name:"doc. PhDr. Běla Plechanovová, CSc.",text:"Od roku 1990 působí na Fakultě sociálních věd Univerzity Karlovy v Praze, kde je zakládající členkou Ústavu politologických studií a spoluautorkou magisterských programů v oblasti mezinárodních vztahů a bezpečnostních studií."},{name:"Mgr. David Broul",text:"Působí jako doktorand na Katedře politologie a evropských studií Univerzity Palackého v Olomouci. Věnuje se problematice evropské integrace, českému předsednictví a je spoluautorem knihy Evropa spolu: průvodce po historii i současnosti Evropské unie."},{name:"JUDr. Jana Kazaz, LLM, SJD",text:"Od roku 2022 pracuje v GLOBSECu, kde se v Centru pro demokracii a odolnost věnuje strategické komunikaci, dezinformacím a hybridním hrozbám. Má doktorát z ústavního práva porovnávacího z CEU v Budapešti a LL.M. se specializací v problematice práva Evropské unie."},{name:"prof. PhDr. Petr Kaniok, Ph.D.",text:"Od roku 2023 působí jako profesor na Katedře mezinárodních vztahů a evropských studií FSS MU a vedoucí Mezinárodního politologického ústavu. V rámci své badatelské a pedagogické činnosti se věnuje institucím EU, politickým systémům EU, mezivládní unii, euroskepticismu, Skandinávii a otázkám evropské integrace."},{name:"Mgr. Helena Drdlová",text:"Je doktorandkou na University of Helsinki, kde se věnuje tématu průmyslové politiky a ekonomice střední a východní Evropy. Vzdělání získala na Masarykově univerzitě v oboru Mezinárodní vztahy a hospodářská politika a na University of Helsinki v programu Global Politics and Communication se zaměřením na globální politickou ekonomii."},{name:"Mgr. Izabela Grundová",text:"Pracuje jako legal a policy officer v klimatickém generálním ředitelství Evropské komise. Zaměřuje se na úpravu emisí skleníkových plynů nezahrnutých v EU ETS a na klimatické plánování a ohlašování členských států. Působí jako kontaktní bod pro Česko v oblasti klimatu."},{name:"Ing. Iveta Jelenová",text:"Má desetiletou zkušenost s agendou EU v rámci Ministerstva financí, kde se věnovala tématům, jako je hospodářská politika, evropský semestr, euro, rozpočtová pravidla EU a makrofinanční pomoc."},{name:"Mgr. Karolína Godál",text:"Působí jako právnička v Evropské sekci Úřadu vlády ČR, kde se věnuje průřezovým agendám, jako jsou brexit nebo právní stát. V roce 2022 byla vyslána do Bruselu v rámci Českého předsednictví v Radě EU jako národní expert pro vztahy EU s Velkou Británií."},{name:"prof. PhDr. Karel B. Müller, Ph.D.",text:"Od roku 2018 je profesorem politologie. V současné době pracuje na vysoké škole CEVRO Institut v Praze. Profesně se věnuje otázkám občanské společnosti, demokracie, veřejné sféry, politické kultury, lobbingu a evropské identity."},{name:"Mgr. Markéta Gregorová",text:"Markéta Gregorová je od roku 2019 poslankyní Evropského parlamentu za Pirátskou stranu. Jejími stěžejními tématy jsou bezpečnostní a zahraniční politika, lidská práva a východní partnerství, včetně rozšiřování Evropské unie."}],ud=({author:e})=>C.jsxs(sm,{children:[C.jsx(am,{children:e?.name}),C.jsx("p",{children:e?.text})]}),fm=e=>Ar`
